import React, { useState } from 'react';
import Sidebar from './Sidebar';
import './Directory.css';
import axios from 'axios';

const url = 'http://localhost:4069/society'; // Adjust the base URL as needed

const Directory = () => {
  const [data, setData] = useState([]);
  const [type, setType] = useState('');

  const fetchAdminData = async () => {
    try {
      const response = await axios.get(`${url}/homepage/getadmin`);
      setData(response.data);
      setType('admin');
    } catch (error) {
      console.error('Failed to fetch admin data:', error);
    }
  };

  const fetchResidentData = async () => {
    try {
      const response = await axios.get(`${url}/homepage/staffs`);
      setData(response.data.residents);
      setType('resident');
    } catch (error) {
      console.error('Failed to fetch resident and staff data:', error);
    }
  };

  const fetchStaffData = async () => {
    try {
      const response = await axios.get(`${url}/homepage/staffs`);
      setData(response.data.staffs);
      setType('staff');
    } catch (error) {
      console.error('Failed to fetch resident and staff data:', error);
    }
  };

  const renderTable = () => {
    if (type === 'admin') {
      return (
        <table>
          <thead>
            <tr>
              <th>Name</th>
              <th>Email</th>
              <th>Contact Number</th>
            </tr>
          </thead>
          <tbody>
            {data.map((admin) => (
              <tr key={admin._id}>
                <td>{admin.name}</td>
                <td>{admin.email}</td>
                <td>{admin.contact}</td>
              </tr>
            ))}
          </tbody>
        </table>
      );
    } else if (type === 'resident') {
      const { residents, staffs } = data;
      return (
        <table>
          <thead>
            <tr>
              <th>Name</th>
              <th>Email</th>
              <th>Contact Number</th>
              <th>Flat Number</th>
            </tr>
          </thead>
          <tbody>
            {data.map((resident) => (
              <tr key={resident._id}>
                <td>{resident.name}</td>
                <td>{resident.email}</td>
                <td>{resident.contact}</td>
                <td>{resident.flat}</td>
              </tr>
            ))}
            </tbody>
          </table>
     );
      } else if (type === "Staff") {
          <table>
            <thead>
              <tr>
                <th>Name</th>
                <th>Email</th>
                <th>Contact Number</th>
                <th>Role</th>
              </tr>
            </thead>
            <tbody>
              {staff.map((staff) => (
                <tr key={staff._id}>
                  <td>{staff.name}</td>
                  <td>{staff.email}</td>
                  <td>{staff.contact}</td>
                  <td>{staff.role}</td>
                </tr>
              ))}
            </tbody>
          </table>
    }
    return null;
  };

  return (
    <div className="page-container">
      <Sidebar />
      <div className="main-content">
        <h2>Directory</h2>
        <button onClick={fetchAdminData}>Admin</button>
        <button onClick={fetchResidentData}>Resident</button>
        <button onClick={fetchStaffData}>Staff</button>
        {renderTable()}
      </div>
    </div>
  );
};

export default Directory;
